  false,\n\t\"url\": null,\n\t\"notes\": \"The Tamarac National Wildlife Refuge Forest
  Management Plan is a general plan which outlines the refuge management objectives,
  forest description, forest management objectives, silvicultural techniques, and
  problem areas relating to forest management on the refuge. This plan consists of
  two sections. Section I pertains to the general management of the forest. Section
  II deals with the data and specific prescription or cultural treatment planned for
  each forest compartment on the refuge. Portions of Section II will be updated each
  year. All appendices to this document will also be included in Section II.\",\n\t\"license_title\":
